import React, { Component } from "react";
import { StyleSheet, ScrollView, Button, View, SafeAreaView, Text, Alert } from "react-native";
import {Picker} from "@react-native-community/picker";

import MonthlyHours from "./Charts/MonthlyHours.js";
import Points from "./Charts/Points.js";
import TypesJobs from "./Charts/TypesJobs.js";

class Analytics extends Component {
  state = {
    language: "java",
  };
  render() {
    return(
        <SafeAreaView style={styles.container}>
          <Picker
            selectedValue={this.state.language}
            style={{height: 50, width: 100}}
            onValueChange={(itemValue, itemIndex) =>
              this.setState({language: itemValue})
            }>
            <Picker.Item label="Java" value="java" />
            <Picker.Item label="JavaScript" value="js" />
          </Picker>
          <View>
            <Text style={styles.title}>
                The title and onPress handler are required. It is recommended to set accessibilityLabel to help make your app usable by everyone.
            </Text>
            <Button
              title="Press me"
              onPress={() => Alert.alert("Simple Button pressed")}
            />
          </View>
          <ScrollView>
            <MonthlyHours/>
            <Points/>
            <TypesJobs/>
          </ScrollView>
        </SafeAreaView>
      );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    marginHorizontal: 16,
  },
  title: {
    textAlign: "center",
    marginVertical: 8,
  },
  fixToText: {
    flexDirection: "row",
    justifyContent: "space-between",
  },
  separator: {
    marginVertical: 8,
    borderBottomColor: "#737373",
    borderBottomWidth: StyleSheet.hairlineWidth,
  },
});

export default Analytics;
